export const getData = async () =>{
    const reqOps = {
        method: 'GET',            
        headers: { 'Content-Type': 'application/json' }
    };

    const datos = fetch(`http://${process.env.REACT_APP_IP_BALANCER}:${process.env.REACT_APP_PORT_BALANCER}/obtenerCPU`, reqOps)
    .then(res => res.json())
    .then(data => {return data});
    console.log(datos)
    return datos
}
